import React from 'react'
import './ProductComponents.css';

function LeftImg({ imageURL, producName, productDesc, tryDemo, learnMore, googlePlay, appStore }) {
  return (
    <section className="product-section left-image">
      <div className="product-container">
        <div className="product-image">
          <img src={imageURL} alt={producName} />
        </div>
        <div className="product-content">
          <h2 className="product-name">{producName}</h2>
          <p className="product-description">{productDesc}</p>
          <div className="product-links">
            {tryDemo && (
              <a href={tryDemo} className="product-link demo-link">
                {tryDemo}
              </a>
            )}
            {learnMore && (
              <a href={learnMore} className="product-link learn-link">
                {learnMore}
              </a>
            )}
          </div>
          {(googlePlay || appStore) && (
            <div className="app-stores">
              {googlePlay && (
                <a href={googlePlay} className="store-link">
                  <img src="/media/images/google-play.png" alt="Google Play" height="40" />
                </a>
              )}
              {appStore && (
                <a href={appStore} className="store-link">
                  <img src="/media/images/app-store.png" alt="App Store" height="40" />
                </a>
              )}
            </div>
          )}
        </div>
      </div>
    </section>
  )
}

export default LeftImg;
